function Intro() {
    return (
      <div className="FullContainer">
          <h1>I'm a full-stack developer based in Portugal</h1>

          <div className="container1">
            <img className="profile-photo" src={"../tiago_costa.jpeg"} alt={"Tiago Costa"}/>
            <h2>Tiago Costa</h2><br />
            <p>Developer</p>

          </div>

      </div>
    );
  }



export default Intro;
